import React from "react";
import '../css/Skill.css'

const Skills = () => {
    let initSkills=[{image:"",title:"javascript"},{image:"",title:"Python"},{image:"",title:"sql"}]
    return(

        <div >
            <div className="Skill_box">
            {initSkills.map((Element) => (
                <p key={Element.title}>  {Element.title}</p>

            ))}
            <img className="image-icon" src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/2048px-HTML5_logo_and_wordmark.svg.png" alt="HTML5 logo" />

            </div>

        </div>
    );
}
export default Skills;
